svg.script:


    function doSomething(evt) 
    { 

      var target = evt.target;

      var circle;

      if(target.nodeName != "circle"){
	      while(target.parentElement.nodeName != "g"){
	      	target = target.parentElement;
	      }
	      var g = target.parentElement;

      	  circle = g.parentElement.children[1];
      }
      else{
      	  circle = target;
      }


      <!-- var offsetTopIcon = circle.cy.animVal.value + 150; -->
      var a = parent.document.getElementById('contentp1');

      var offsetTopParagraph = a.offsetTop - 3*a.parentNode.childNodes[0].offsetHeight - parent.document.getElementById('navBar').offsetHeight;

      parent.window.scrollTo(0, offsetTopParagraph);
    }



